DROP TABLE IF EXISTS `design_desform_head`;
CREATE TABLE `design_desform_head`  (
  `id` bigint(0) NOT NULL COMMENT '主键ID',
  `tenant_id` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '000000' COMMENT '租户ID',
  `cgform_head_id` bigint(0) NULL DEFAULT NULL COMMENT '表单id',
  `form_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '表单名称',
  `form_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '表单编码',
  `form_icon` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '表单图标',
  `form_design_json` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '表单json',
  `form_type` int(0) NULL DEFAULT 1 COMMENT '类型：1=主表，2=子表',
  `parent_id` bigint(0) NULL DEFAULT NULL COMMENT '父级id',
  `parent_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '父级编码',
  `mobile_view` int(0) NULL DEFAULT NULL COMMENT '手机模式：0=否 1=是',
  `create_user` bigint(0) NULL DEFAULT NULL COMMENT '创建人',
  `create_dept` bigint(0) NULL DEFAULT NULL COMMENT '创建部门',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_user` bigint(0) NULL DEFAULT NULL COMMENT '修改人',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `status` int(0) NULL DEFAULT 0 COMMENT '状态',
  `is_deleted` int(0) NULL DEFAULT 0 COMMENT '是否已删除',
  `nologin_select` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '0' COMMENT '不登录是否可以查询-0=否，1=是',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '表单设计器基本属性' ROW_FORMAT = Dynamic;

