INSERT INTO `onl_cgform_enhance_js` VALUES (1629020043905724418, '000000', 'columnInit(that){\r\n    that.tableOption = {\r\n        ...that.tableOption,\r\n        labelWidth: 120,\r\n        menuWidth: 100,\r\n        searchLabelWidth: 120,\r\n    }\r\n    that.tableOption.column = that.tableOption.column.map(item => {\r\n        if (item.prop == \'wx_name\') {\r\n            item.editDisabled = true\r\n        }\r\n        if (window.location.href.indexOf(\'chatgpt.fyutest.com\') == -1 && item.prop == \"is_agent\") {\r\n            item.display = false\r\n            item.hide = true\r\n        }\r\n        return item\r\n    })\r\n},\r\n// 人工修改次数按钮\r\nupdate_count_btn(that){\r\n    if (that.tableSelectId.length === 0) {\r\n        return that.$message({\r\n            type: \'info\',\r\n            message: \'请先选择用户！\'\r\n        })\r\n    }\r\n    console.log(\'选中的id\', that.tableSelectId)\r\n    that.isFormViewControl = true //启用控件\r\n    that.FormViewControlOption = {\r\n        ...that.FormViewControlOption,\r\n        viewObj: {\r\n            isShow: true,\r\n            type: \'dialog\',\r\n            title: \'修改次数\',\r\n            width: \'40%\',\r\n            destroy: true,\r\n            isGetData: false,\r\n            carryInit: true,\r\n        },\r\n        formId: \'1632564111864573954\', //表单设计id\r\n        formOpenType: \'add\',\r\n        actionData: {\r\n            type: \'returnData\', //提交类型\r\n            noRouter: true,\r\n            closeType: \'hidegetData\',\r\n            isMessage: false,\r\n        },\r\n        btnPermissions: {\r\n            cancelBtn: false,\r\n            submitBtn: false,\r\n        },\r\n        defaultData: {\r\n            ids: that.tableSelectId\r\n        },\r\n    }\r\n},\r\n', 'list', NULL, 1625772668151959553, 1123598821738675201, 1123598813738675201, '2023-02-24 15:26:59', 1123598821738675201, '2023-03-27 14:18:39', 1, 0);
