INSERT INTO `onl_cgform_enhance_js` VALUES (1631198047406657538, '000000', 'button1(that, row){\r\n\r\n    that.isFormViewControl = true //启用控件\r\n    console.log(row)\r\n    that.FormViewControlOption = {\r\n        ...that.FormViewControlOption,\r\n        viewObj: {\r\n            isShow: true, //是否显示表单\r\n            type: \'drawer\', //弹窗类型  表单:view  抽屉:drawer 弹窗:dialog\r\n            title: \'编辑\', //标题文本\r\n            width: \'60%\', //弹窗宽度\r\n            destroy: false,//关闭时是否销毁元素\r\n            isGetData: false,//是否需要获取数据\r\n            carryInit: false,//是否需要重新初始化表单配置\r\n        },\r\n        formId: \'1631190786655469570\', //表单设计id\r\n        formOpenType: \'add\', //当前弹窗类型 add edit view\r\n        actionData: {\r\n            type: \'onlineEdit\', //提交类型\r\n            noRouter: true,//不启用路由配置\r\n            closeType: \'hidegetData\',//关闭类型 hide:关闭 hidegetData:关闭并重新获取表格数据\r\n            isMessage: false,//是否有提交成功提示\r\n        },\r\n        btnPermissions: { //是否显示按钮\r\n            clearBtn: true, //清空按钮\r\n            cancelBtn: false, //取消按钮\r\n            submitBtn: true, //提交按钮\r\n        },\r\n        onlineFormId: \'1631191715396009985\', //表单开发id 用于获取数据\r\n        params: {},//获取数据请求参数\r\n        defaultData: {\r\n            id: row.id,\r\n            name2: row.name2,\r\n            class2: row.class2,\r\n            describe2: row.describe2,\r\n            create_dept:row.create_dept,\r\n            create_time:row.create_time,\r\n            create_user:row.create_user,\r\n            is_deleted:row.is_deleted,\r\n            status:row.status,\r\n            tenant_id:row.tenant_id,\r\n            update_time:row.update_time,\r\n            update_user:row.update_user\r\n        },//默认数据 默认会赋值给表单\r\n    }\r\n}', 'list', NULL, 1631191715396009985, 1123598821738675201, 1123598813738675201, '2023-03-02 15:41:35', 1123598821738675201, '2023-03-10 09:50:09', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1631236375157977089, '000000', 'button1(that,row){\r\n    that.tableSelectData.forEach((item)=>{\r\n        item.describe3 = \'真好玩\'\r\n    })\r\n    console.log(that,row,\'button1按钮被触发了\')\r\n    that.form.setFieldsValue({\r\n        id:row.id,\r\n        name:row.name3,\r\n        class3:row.class3,\r\n        describe3:row.describe3\r\n    }) \r\n    that.isFormViewControl=true\r\n    that.FormViewControlOption={\r\n        ...that.FormViewControlOption,\r\n        viewObj: {\r\n            isShow:true, //是否显示表单\r\n            type:\'dialog\', //弹窗类型  表单:view  抽屉:drawer 弹窗:dialog\r\n            title:\'修改信息\', //标题文本\r\n            width:\'50%\', //弹窗宽度\r\n            destroy:false,//关闭时是否销毁元素\r\n            isGetData:false,//是否需要获取数据\r\n        	carryInit:false,//是否需要重新初始化表单配置\r\n        },\r\n        formId: \'1631190786655469570\', // 表单设计id\r\n        formOpenType: \'edit\', // 当前弹窗类型 add edit view\r\n        actionData: {\r\n            type: \'onlineEdit\',\r\n            noRouter: true,\r\n            closeType: \'hidegetData\',\r\n            isMessage: true\r\n        },\r\n        btnPermissions:{\r\n            cancelBtn: true\r\n        },\r\n        onlineFormId:\'1631227592729997313\',\r\n        defaultData: {\r\n            id:row.id,\r\n            name3:row.name3,\r\n            class3:row.class3,\r\n            describe3:row.describe3\r\n        }\r\n    }\r\n},\r\nbutton2(){\r\n    that.initTableData().then(()=>{\r\n        console.log(\'数据重新加载成功\')\r\n    })\r\n},\r\nselectionChange(that,data){\r\n    console.log(that,data,\'选择之后触发\')\r\n}\r\n', 'list', NULL, 1631227592729997313, 1123598821738675201, 1123598813738675201, '2023-03-02 18:13:53', 1123598821738675201, '2023-03-13 09:51:55', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1631536797655572482, '000000', 'created(that){\r\n    console.log(\'that实例\',that)\r\n},\r\ncolumnInit(that){\r\n    that.setTableOptionsFun(\'test_work\',{\r\n        overHidden: true\r\n    })\r\n},\r\n// 添加下级按钮\r\ntest_add_lower(that,row){\r\n    that.isTableView=true\r\n    alert(row.id)\r\n	that.tableViewOptionData={\r\n		...that.tableViewOptionData,\r\n		viewObj:{\r\n			type:\'drawer\',\r\n			// type:\'dialog\',\r\n			title:\'添加下级\',\r\n			width:\'60%\',\r\n			isShow:\'true\',\r\n            destroy:false,\r\n		},\r\n        tableId:\'1631534343111118850\',\r\n        searchObj:{\r\n            lower_supid: row.id\r\n        },\r\n        params:{\r\n            //是否隐藏头部\r\n            hideHeader:false,\r\n            //其他方法 可以自定义方法给当前弹出表格调用\r\n            transmitFun:()=>{}, \r\n            //其他参数 可以自定义参数给当前弹出表格使用\r\n            otherParams:{\r\n                lower_id: row.id\r\n            },\r\n        },\r\n	}\r\n}\r\n', 'list', NULL, 1631532059560030210, 1123598821738675201, 1123598813738675201, '2023-03-03 14:07:40', 1123598821738675201, '2023-03-04 16:48:18', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1631539110059253762, '000000', 'rowClick(that,obj){\r\n    console.log(obj)\r\n},\r\ntest_add_down(that, row){\r\n    console.log(row.id)\r\n    that.isTableView = true //启用控件\r\n    that.tableViewOptionData = {\r\n        ...that.tableViewOptionData,\r\n        viewObj: {\r\n            type: \'dialog\',//打开方式 dialog弹窗  drawer抽屉\r\n            title: \'用户下级表\',//标题\r\n            width: \'60%\',//宽度\r\n            isShow: \'true\',//是否显示\r\n            destroy: false,//关闭时是否销毁元素\r\n        },\r\n        tableId: \'1631532918243110914\',//表单开发id\r\n        searchObj:{\r\n            test_leaderid:row.id\r\n        },//默认搜索值 清空搜索也不会丢失\r\n        params: {\r\n            hideHeader: false,//是否隐藏顶部按钮\r\n            transmitFun: () => { \r\n\r\n            }, //其他方法 可以自定义方法给当前弹出表格调用\r\n             otherParams:{\r\n             },//其他参数 可以自定义参数给当前弹出表格使用\r\n        },//其他配置（扩展功能 默认不用配置）\r\n    }\r\n    \r\n}\r\n\r\n', 'list', NULL, 1631530459168813057, 1123598821738675201, 1123598813738675201, '2023-03-03 14:16:51', 1123598821738675201, '2023-03-13 15:46:26', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1631545615047270402, '000000', 'created(that){\r\n    that.tableOption = {\r\n        ...that.tableOption,\r\n        menuWidth: 180,\r\n    }\r\n},\r\nsetDataFun(that,data){\r\n    console.log(\'$props\',that.$props)\r\n    let sobj = that.$props.otherParams\r\n    return new Promise(resolve => {\r\n        if (sobj) {\r\n            data = data.filter(item => item.test_lower_supid == sobj.lower_id)\r\n            return resolve(data)\r\n        }\r\n        resolve(data)\r\n    })\r\n},\r\ntest_add_loweruser(that){\r\n    let sobj = that.$props.otherParams\r\n    that.isTableSelectControl=true //启用控件\r\n    that.tableSelectControlOption={\r\n        ...that.tableSelectControlOption,\r\n        title:\'添加用户\',//标题\r\n        isDialog:true,//是否显示控件\r\n        destroy:true,//关闭时是否销毁元素\r\n        width:\'60%\',//弹窗宽度\r\n        tableId:\'1631534343111118850\',//表格id\r\n        option:{\r\n            addBtn:false,\r\n            columnBtn:false,\r\n            searchShowBtn:false,\r\n            refreshBtn:false,\r\n            menu:false,\r\n            selection:true,\r\n            border:true,\r\n            searchMenuSpan: 6,\r\n            searchMenuPosition: \'left\',\r\n            searchIndex: 3,\r\n            selectable:(row,index)=>{\r\n                return row.test_lower_supid !== sobj.lower_id\r\n            },\r\n            column:[\r\n                ...that.tableOption.column\r\n            ]\r\n        },//avue表格相关配置\r\n        multiple:true,//是否多选\r\n        isPage:false,//是否分页\r\n        addType:{\r\n        	type:\'customDispose\',//添加方法类型\r\n        	// type:\'resetAddTableData\',//添加方法类型\r\n        	tableId:\'1631534343111118850\',//添加数据表格id\r\n        	isCell:\'false\',//是否可以编辑\r\n      	},\r\n        defaultData:{},//给勾选数据默认追加的数据\r\n        searchData:{\r\n        },//表格默认搜索数据 \r\n        carryData:{\r\n        },//点击确定后默认携带数据\r\n        noDisposeData:true,//不需要做处理\r\n        submitFun:(that,obj)=>{\r\n            console.log(\'objjjj\',obj)\r\n            for(let i=0;i<obj.data.length;i++){\r\n                obj.data[i].test_lower_supid = sobj.lower_id\r\n                this._postAction(`${that.apiRequestHead}/cgform-api/editData/1631534343111118850`,{\r\n                    data:obj.data[i],\r\n                })\r\n            }\r\n            that.$message({\r\n                type: \'success\',\r\n                message: \'添加下级用户成功!\'\r\n            })\r\n            that.tableSelectControlOption={\r\n                ...that.tableSelectControlOption,\r\n                isDialog:false\r\n            }\r\n        },//自定义确认方法\r\n    }\r\n},\r\n', 'list', NULL, 1631534343111118850, 1123598821738675201, 1123598813738675201, '2023-03-03 14:42:42', 1123598821738675201, '2023-03-04 16:46:52', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1631548934851469314, '000000', '\r\ntest_add_userdown(that, row){\r\n    /* that.tableOption = {\r\n        ...that.tableOption,\r\n        selectable: (row, index) => {\r\n            console.log(row, index, 666)\r\n            //true:可选择  false:禁用选择\r\n            return false\r\n        }\r\n    } */\r\n    that.isTableSelectControl = true //启用控件\r\n    that.tableSelectControlOption = {\r\n        ...that.tableSelectControlOption,\r\n        title: \'添加下级用户\',//标题\r\n        isDialog: true,//是否显示控件\r\n        destroy: true,//关闭时是否销毁元素\r\n        width: \'60%\',//弹窗宽度\r\n        tableId: \'1631532918243110914\',//表格id\r\n        option: {\r\n            addBtn: false,\r\n            columnBtn: false,\r\n            searchShowBtn: false,\r\n            refreshBtn: false,\r\n            menu: false,\r\n            selection: true,\r\n            border: true,\r\n            searchMenuSpan: 6,\r\n            searchMenuPosition: \'left\',\r\n            searchIndex: 3,\r\n            selectable(row) {\r\n                if (that.$props.searchObj) {\r\n                    return row.test_leaderid !== that.$props.searchObj.test_leaderid\r\n                }\r\n            },\r\n            column: [\r\n                ...that.tableOption.column\r\n            ]\r\n        },//avue表格相关配置\r\n        multiple: true,//是否多选\r\n        isPage: false,//是否分页\r\n        addType: {\r\n            type: that.$props.searchObj ? \'customDispose\' : \'resetAddTableData\',//添加方法类型\r\n            tableId: \'1631532918243110914\',//添加数据表格id\r\n            isCell: \'true\',//是否可以编辑\r\n        },\r\n        defaultData: {\r\n\r\n        },//给勾选数据默认追加的数据\r\n        searchData: {},//表格默认搜索数据 \r\n        carryData: {\r\n        },//点击确定后默认携带数据\r\n        noDisposeData: true,//不需要做处理\r\n        submitFun: (that, obj) => {\r\n            let apiArr = []\r\n            if (that.$props.searchObj) {\r\n                obj.data.forEach((item, index) => {\r\n                    item.test_leaderid = that.$props.searchObj.test_leaderid\r\n                    apiArr[index] = this._postAction(`${that.apiRequestHead}/cgform-api/editData/1631532918243110914`, {\r\n                        data: item,\r\n                    })\r\n                })\r\n            }\r\n            Promise.all(apiArr).then((res) => {\r\n                that.$message({\r\n                    message: \'添加成功\',\r\n                    type: \'success\'\r\n                })\r\n\r\n            })\r\n        },//自定义确认方法\r\n    }\r\n},\r\nsetDataFun(that, data){\r\n    return new Promise((res, rej) => {\r\n        if (that.$props.searchObj) {\r\n            data = data.filter(item => item.test_leaderid == that.$props.searchObj.test_leaderid)\r\n            res(data)\r\n        } else {\r\n            res(data)\r\n        }\r\n\r\n    })\r\n}\r\n\r\n', 'list', NULL, 1631532918243110914, 1123598821738675201, 1123598813738675201, '2023-03-03 14:55:53', 1123598821738675201, '2023-03-14 09:56:39', 1, 0);
