INSERT INTO `onl_cgform_enhance_js` VALUES (1633300884391559169, '000000', 'beforeAdd(that){\r\n    \r\n    that.tableForm.fun_json=`return { //例子\r\n    color: \'88,241,236\',//rgb颜色  背景颜色    \r\n    textColor:\'#095C52\',//文本颜色\r\n    text: \'我要向{value}做{length}的{scene}\',//拼接文本 {value}用户输入的值    \r\n    theme:\'\',//主题\r\n    title: \'你要向谁做汇报？输入对象与主题\',//标题\r\n    tip: \'例如：\',//例子\r\n    maxLength:1000,//最大输入文本数     \r\n    shortcutList: [ //快捷选择配置         \r\n        {\r\n            title: \'场景\',\r\n            key: \'scene\',\r\n            type: \'input\',//控件类型\r\n            value:\'场景\',//默认值\r\n        },\r\n        {\r\n            title: \'长度\', \r\n            key: \'length\',\r\n            type: \'checkbox\',\r\n            dicData: [\'较短\', \'中等\', \'较长\'],//控件字典\r\n            value:\'较短\',//默认值\r\n        }\r\n    ]\r\n}\r\n`\r\n},\r\ncellStyle(that,{columnIndex}){\r\n    if(columnIndex==3){\r\n        return {\r\n             backgroundColor:\'rgba(0,0,0,.5)\',\r\n        }\r\n    }\r\n}', 'list', NULL, 1633293940490600449, 1123598821738675201, 1123598813738675201, '2023-03-08 10:57:31', 1123598821738675201, '2023-03-14 17:03:41', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1633639870062497793, '000000', 'compile(that, row){\r\n    that.isFormViewControl = true //启用控件\r\n    that.FormViewControlOption = {\r\n        ...that.FormViewControlOption,\r\n        viewObj: {\r\n            isShow: true, //是否显示表单\r\n            type: \'dialog\', //弹窗类型  表单:view  抽屉:drawer 弹窗:dialog\r\n            title: \'编辑\', //标题文本\r\n            width: \'40%\', //弹窗宽度\r\n            destroy: false,//关闭时是否销毁元素\r\n            isGetData: false,//是否需要获取数据\r\n            carryInit: false,//是否需要重新初始化表单配置\r\n        },\r\n        formId: \'1633397142930165762\', //表单设计id\r\n        formOpenType: \'add\', //当前弹窗类型 add edit view\r\n        actionData: {\r\n            type: \'onlineEdit\', //提交类型\r\n            noRouter: true,//不启用路由配置\r\n            closeType: \'hidegetData\',//关闭类型 hide:关闭 hidegetData:关闭并重新获取表格数据\r\n            isMessage: true,//是否有提交成功提示\r\n        },\r\n        btnPermissions: { //是否显示按钮\r\n            clearBtn: false, //清空按钮\r\n            cancelBtn: false, //取消按钮\r\n            submitBtn: false, //提交按钮\r\n        },\r\n        params: {},//获取数据请求参数\r\n        defaultData: {\r\n            id:row.id,\r\n            one_rate:row.one_rate.slice(0,row.one_rate.length-1),\r\n            two_rate:row.two_rate.slice(0,row.two_rate.length-1),\r\n            view_phone:row.view_phone,\r\n            remark:row.remark\r\n        },//默认数据 默认会赋值给表单\r\n    }\r\n},\r\nsetDataFun(that,data){\r\n    data.forEach((item)=>{\r\n        item.one_rate = item.one_rate*100+\'%\'\r\n        item.two_rate = item.two_rate*100+\'%\'\r\n    })\r\n    return new Promise((res,rej)=>{\r\n        res(data)\r\n    })\r\n}\r\n', 'list', NULL, 1633304324450648066, 1123598821738675201, 1123598813738675201, '2023-03-09 09:24:31', 1123598821738675201, '2023-03-09 16:45:35', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1633652730205409281, '000000', 'beforeEdit(that,formData){\r\n    console.log(\'修改\')\r\n},\r\nbeforeAdd(that){\r\n    console.log(\'新增\')\r\n}', 'list', NULL, 1628597171869544449, 1123598821738675201, 1123598813738675201, '2023-03-09 10:15:37', 1123598821738675201, '2023-03-09 10:41:39', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1633722902286999554, '000000', 'ceshi(){\r\n    that.isFormViewControl=true //启用控件\r\n    that.FormViewControlOption={\r\n        ...that.FormViewControlOption,\r\n        viewObj: {\r\n            isShow:false, //是否显示表单\r\n            type:\'drawer\', //弹窗类型  表单:view  抽屉:drawer 弹窗:dialog\r\n            title:\'测试\', //标题文本\r\n            width:\'50%\', //弹窗宽度\r\n            destroy:false,//关闭时是否销毁元素\r\n            isGetData:false,//是否需要获取数据\r\n        	carryInit:false,//是否需要重新初始化表单配置\r\n        },\r\n        formId: \'\', //表单设计id\r\n        formOpenType: \'\', //当前弹窗类型 add edit view\r\n        actionData: {\r\n            type:\'\', //提交类型\r\n            noRouter:true,//不启用路由配置\r\n            closeType:\'\',//关闭类型 hide:关闭 hidegetData:关闭并重新获取表格数据\r\n            isMessage:false,//是否有提交成功提示\r\n        },\r\n        btnPermissions: { //是否显示按钮\r\n            clearBtn: true, //清空按钮\r\n        	cancelBtn: false, //取消按钮\r\n        	submitBtn: true, //提交按钮\r\n        },\r\n        onlineFormId:\'\', //表单开发id 用于获取数据\r\n        params:{},//获取数据请求参数\r\n        defaultData:{\r\n\r\n        },//默认数据 默认会赋值给表单\r\n    }\r\n}', 'list', NULL, 1633302730053091330, 1123598821738675201, 1123598813738675201, '2023-03-09 14:54:28', 1123598821738675201, '2023-03-09 14:54:28', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1635121013878173697, '000000', 'button1(){\r\n    that.isTableView=true //启用控件\r\n	that.tableViewOptionData={\r\n		...that.tableViewOptionData,\r\n		viewObj:{\r\n			type:\'dialog\',//打开方式 dialog弹窗  drawer抽屉\r\n			title:\'这是其他表格\',//标题\r\n			width:\'100%\',//宽度\r\n			isShow:\'true\',//是否显示\r\n            destroy:false,//关闭时是否销毁元素\r\n		},\r\n        tableId:\'1635099048350146562\',//表单开发id\r\n        searchObj:{},//默认搜索值 清空搜索也不会丢失\r\n        params:{\r\n           hideHeader:true,//是否隐藏头部\r\n           transmitFun:()=>{}, //其他方法 可以自定义方法给当前弹出表格调用\r\n           otherParams:{},//其他参数 可以自定义参数给当前弹出表格使用\r\n        },//其他配置（扩展功能 默认不用配置）\r\n	}\r\n}\r\n', 'list', NULL, 1635099048350146562, 1123598821738675201, 1123598813738675201, '2023-03-13 11:30:03', 1123598821738675201, '2023-03-13 11:35:47', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1635570446772023297, '000000', 'button(){\r\n    that.isTableTreeControl=true //启用控件\r\n    that.tableTreeControlOption={\r\n        ...that.tableTreeControlOption,\r\n        apiName:\'\',// 空获取树表单开发数据  getData：表单开发数据 getTreeData：请求获取 externalData：外部数据  treeData\r\n        treeData:[],\r\n        isRefresh:false,//每次打开是否重新获取数据\r\n        tableId: \'1635569546926043137\', //表单开发id\r\n        defaultTree: [],//默认勾选的值\r\n        stopTree: [],//禁用勾选值\r\n        isDialog: true,//是否显示控件\r\n        destroy:false,//关闭时是否销毁元素\r\n        defaultProps: {}, //显示字段\r\n        defaulKey: \'\', //树绑定key\r\n        title: \'kankan\',  //标题\r\n        addType: {\r\n          type: \'\', //新增类型 apiAdd 通过api批量新增数据 subDataAdd 子表数据新增\r\n          tableId: \'\', // 表格id\r\n          isCell:\'\',//是否添加行编辑字段\r\n        },\r\n        asyncTableName: \'\', //存储同步表id的字段名\r\n        asyncTableIdName:\'\',//同步表的数据唯一id字段名\'\r\n        radio:true,//单选\r\n    }\r\n}', 'list', NULL, 1635569546926043137, 1123598821738675201, 1123598813738675201, '2023-03-14 17:15:57', 1123598821738675201, '2023-03-14 17:17:42', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1638003911634190337, '000000', 'test_lzk_button(that, row){\r\n    console.log(11111, that.$props)\r\n    that.isTableSelectControl = true //启用控件\r\n    that.tableSelectControlOption = {\r\n        ...that.tableSelectControlOption,\r\n        title: \'添加下级用户\',//标题\r\n        isDialog: true,//是否显示控件\r\n        destroy: true,//关闭时是否销毁元素\r\n        width: \'80%\',//弹窗宽度\r\n        tableId: that.currCodeId,//表格id\r\n        option: {\r\n            addBtn: false,\r\n            columnBtn: false,\r\n            searchShowBtn: false,\r\n            refreshBtn: false,\r\n            menu: false,\r\n            selection: true,\r\n            border: true,\r\n            searchMenuSpan: 6,\r\n            searchMenuPosition: \'left\',\r\n            searchIndex: 3,\r\n            selectable(row) {\r\n                if (that.$props.searchObj) {\r\n                    return row.test_leaderid !== that.$props.searchObj.test_leaderid\r\n                }\r\n            },\r\n            column: [\r\n                ...that.tableOption.column\r\n            ]\r\n        },//avue表格相关配置\r\n        multiple: true,//是否多选\r\n        isPage: false,//是否分页\r\n        addType: {\r\n            type: that.$props.searchObj ? \'customDispose\' : \'resetAddTableData\',//添加方法类型\r\n            tableId: that.currCodeId,//添加数据表格id\r\n            isCell: \'true\',//是否可以编辑\r\n        },\r\n        defaultData: {\r\n\r\n        },//给勾选数据默认追加的数据\r\n        searchData: {},//表格默认搜索数据 \r\n        carryData: {\r\n        },//点击确定后默认携带数据\r\n        noDisposeData: true,//不需要做处理\r\n        submitFun: (that, obj) => {\r\n            let apiArr = []\r\n            if (that.$props.searchObj) {\r\n                obj.data.forEach((item, index) => {\r\n                    item.test_leaderid = that.$props.searchObj.test_leaderid\r\n                    apiArr[index] = this._postAction(`${that.apiRequestHead}/cgform-api/editData/1631532918243110914`, {\r\n                        data: item,\r\n                    })\r\n                })\r\n            }\r\n            Promise.all(apiArr).then((res) => {\r\n                that.$message({\r\n                    message: \'添加成功\',\r\n                    type: \'success\'\r\n                })\r\n\r\n            })\r\n        },//自定义确认方法\r\n    }\r\n},\r\nsetDataFun(that, data){\r\n    console.log(1111, that.$props)\r\n    return new Promise((res, rej) => {\r\n        if (that.$props.searchObj) {\r\n            data = data.filter(item => item.test_leaderid == that.$props.searchObj.test_leaderid)\r\n            res(data)\r\n        } else {\r\n            res(data)\r\n        }\r\n\r\n    })\r\n}\r\n\r\n', 'list', NULL, 1637991774191906818, 1123598821738675201, 1123598813738675201, '2023-03-21 10:25:40', 1123598821738675201, '2023-03-21 13:34:00', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1638053844962799618, '000000', 'test_lzk_button(that, row){\r\n    // console.log(row.id)\r\n    that.isTableView = true //启用控件\r\n    that.tableViewOptionData = {\r\n        ...that.tableViewOptionData,\r\n        viewObj: {\r\n            type: \'dialog\',//打开方式 dialog弹窗  drawer抽屉\r\n            title: \'用户下级表\',//标题\r\n            width: \'80%\',//宽度\r\n            isShow: \'true\',//是否显示\r\n            destroy: false,//关闭时是否销毁元素\r\n        },\r\n        tableId: \'1638056047486156802\',//表单开发id\r\n        searchObj:{\r\n            test_id:row.id\r\n        },//默认搜索值 清空搜索也不会丢失\r\n        params: {\r\n            hideHeader: false,//是否隐藏顶部按钮\r\n            transmitFun: () => { \r\n\r\n            }, //其他方法 可以自定义方法给当前弹出表格调用\r\n            otherParams:{\r\n                test_id: row.id\r\n            },//其他参数 可以自定义参数给当前弹出表格使用\r\n        },//其他配置（扩展功能 默认不用配置）\r\n    }\r\n    \r\n}\r\n\r\n', 'list', NULL, 1637986876196941826, 1123598821738675201, 1123598813738675201, '2023-03-21 13:44:05', 1123598821738675201, '2023-03-27 11:53:56', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1638060124813160449, '000000', 'created (that) {\r\n    that.tableOption={\r\n        ...that.tableOption,\r\n        menuWidth: 120\r\n    }\r\n},\r\nsetDataFun(that, data){\r\n    return new Promise((res, rej) => {\r\n        let arr = []\r\n        if (that.$props.otherParams) {\r\n            // console.log(111111, data)\r\n            data.forEach(item => {\r\n                if (item.test_superiorID == that.$props.otherParams.test_id) {\r\n                    arr.push(item)\r\n                }\r\n            })\r\n            res(arr)\r\n        } else {\r\n            res(arr)\r\n        }\r\n\r\n    })\r\n},\r\n// 点击添加用户\r\ntest_child_button(that){\r\n    // console.log(\'that.tableOption.column\', [...that.tableOption.column])\r\n    that.isTableSelectControl=true //启用控件\r\n    that.tableSelectControlOption={\r\n        ...that.tableSelectControlOption,\r\n        title:\'添加用户\',//标题\r\n        isDialog:true,//是否显示控件\r\n        destroy:true,//关闭时是否销毁元素\r\n        width:\'80%\',//弹窗宽度\r\n        tableId:\'1638056047486156802\',//表格id\r\n        option:{\r\n            selectable(row) {\r\n                // console.log(\'row\', row)\r\n                if (that.$props.otherParams) {\r\n                    if (row.test_superiorID !== that.$props.otherParams.test_id) {\r\n                        return true\r\n                    }    \r\n                }\r\n            },\r\n            addBtn:false,\r\n            columnBtn:false,\r\n            searchShowBtn:false,\r\n            refreshBtn:false,\r\n            menu:false,\r\n            selection:true,\r\n            border:true,\r\n            searchMenuSpan: 6,\r\n            searchMenuPosition: \'left\',\r\n            searchIndex: 3,\r\n            column:[\r\n                ...that.tableOption.column\r\n            ],\r\n        },//avue表格相关配置\r\n        multiple:true,//是否多选\r\n        isPage:false,//是否分页\r\n        addType:{\r\n        	type:\'customDispose\',//添加方法类型\r\n        	tableId:\'1638056047486156802\',//添加数据表格id\r\n        	isCell:\'true\',//是否可以编辑\r\n      	},\r\n        defaultData:{},//给勾选数据默认追加的数据\r\n        searchData:{},//表格默认搜索数据 \r\n        carryData:{},//点击确定后默认携带数据\r\n        noDisposeData:true,//不需要做处理\r\n        submitFun:(that,obj)=>{\r\n            let arr = []\r\n            if (that.$props.otherParams) {\r\n                obj.data.forEach((item, index) => {\r\n                    item.test_superiorID = that.$props.otherParams.test_id\r\n                    arr[index] = this._postAction(`${that.apiRequestHead}/cgform-api/editData/1638056047486156802`, {\r\n                        data: item,\r\n                    })\r\n                })\r\n                // console.log(\'arrrrrr\', arr[0])\r\n                 Promise.all(arr).then((res) => {\r\n                    that.$message({\r\n                        message: \'添加成功\',\r\n                        type: \'success\'\r\n                    })\r\n                    that.$router.go(0)\r\n                })\r\n            }\r\n            // console.log(\'that\', that.$props, \'obj\',obj.data)\r\n        },//自定义确认方法\r\n    }\r\n}\r\n\r\n', 'list', NULL, 1638056047486156802, 1123598821738675201, 1123598813738675201, '2023-03-21 14:09:02', 1123598821738675201, '2023-03-27 10:40:16', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1638092196403507201, '000000', 'columnInit(that){\r\n    that.setTableOptionsFun(\'remark\',{\r\n        overHidden: true\r\n    })\r\n    that.setTableOptionsFun(\'withdrawal_state\',{\r\n        searchValue: \"0\"\r\n    })\r\n},\r\ncreated(that){    \r\n    that.tableOption={\r\n        ...that.tableOption,\r\n        menuWidth: 120\r\n    }\r\n    that.isFormViewControl=true //启用控件\r\n    that.FormViewControlOption={\r\n        ...that.FormViewControlOption,\r\n        viewObj: {\r\n            isShow:false, //是否显示表单\r\n            type:\'dialog\', //弹窗类型  表单:view  抽屉:drawer 弹窗:dialog\r\n            title:\'收款码提现审核\', //标题文本\r\n            width:\'40%\', //弹窗宽度\r\n            destroy:false,//关闭时是否销毁元素\r\n            isGetData:false,//是否需要获取数据\r\n        	carryInit:true,//是否需要重新初始化表单配置\r\n        },\r\n        formId: \'1639150976117534721\', //表单设计id\r\n        formOpenType: \'edit\',\r\n        actionData: {\r\n            type:\'returnData\', //提交类型\r\n            noRouter:true,//不启用路由配置\r\n            closeType:\'hidegetData\',//关闭类型 hide:关闭 hidegetData:关闭并重新获取表格数据\r\n            isMessage:true,//是否有提交成功提示\r\n        },\r\n        btnPermissions: {\r\n            clearBtn: false, //清空按钮\r\n        	cancelBtn: false, //取消按钮\r\n        	submitBtn: false, //提交按钮\r\n        },\r\n        onlineFormId:\'\', //表单开发id 用于获取数据\r\n        params:{},//获取数据请求参数\r\n        \r\n    }\r\n},\r\nstatus_audit(that,row){\r\n    console.log(\'row===\',row)\r\n    let userinfo = JSON.parse(localStorage.getItem(\'saber-userInfo\')) \r\n    that.FormViewControlOption={\r\n        ...that.FormViewControlOption,\r\n        defaultData:{\r\n            id: row.id,\r\n            wxuser_id: row.wxuser_id,\r\n            view_wxname: row.view_wxname,\r\n            view_phone: row.view_phone,\r\n            code_url: row.code_url,\r\n            received_amount: row.received_amount,\r\n            withdrawal_state: \'待审核\',\r\n            auditor: userinfo.content.nick_name,\r\n            remark: row.remark,\r\n            create_time: row.create_time,\r\n            create_dept: row.create_dept,\r\n            create_user: row.create_user,\r\n            is_deleted: row.is_deleted,\r\n            withdrawal_time: row.withdrawal_time,\r\n            withdrawal_amount: row.withdrawal_amount,\r\n            tenant_id: row.tenant_id,\r\n            status: row.status,\r\n            fee_amount: row.fee_amount,\r\n            auditor_blade_user_id: userinfo.content.user_id\r\n        },//默认数据 默认会赋值给表单\r\n    }\r\n    that.FormViewControlOption.viewObj.isShow = true\r\n}', 'list', NULL, 1638003962453454850, 1123598821738675201, 1123598813738675201, '2023-03-21 16:16:29', 1123598821738675201, '2023-03-27 10:05:42', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1638428959760216066, '000000', 'PopUupForm () {\r\n    that.isFormViewControl=true //启用控件\r\n    that.FormViewControlOption={\r\n        ...that.FormViewControlOption,\r\n        viewObj: {\r\n            isShow:true, //是否显示表单\r\n            type:\'drawer\', //弹窗类型  表单:view  抽屉:drawer 弹窗:dialog\r\n            title:\'弹出表单\', //标题文本\r\n            width:\'80%\', //弹窗宽度\r\n            destroy:true,//关闭时是否销毁元素\r\n            isGetData:false,//是否需要获取数据\r\n        	carryInit:false,//是否需要重新初始化表单配置\r\n        },\r\n        formId: \'1638428220286455809\', //表单设计id\r\n        formOpenType: \'add\', //当前弹窗类型 add edit view\r\n        actionData: {\r\n            type:\'onlineAdd\', //提交类型\r\n            noRouter:true,//不启用路由配置\r\n            closeType:\'\',//关闭类型 hide:关闭 hidegetData:关闭并重新获取表格数据\r\n            isMessage:false,//是否有提交成功提示\r\n        },\r\n        btnPermissions: { //是否显示按钮\r\n            clearBtn: true, //清空按钮\r\n        	cancelBtn: false, //取消按钮\r\n        	submitBtn: true, //提交按钮\r\n        },\r\n        onlineFormId:\'1638428042407211009\', //表单开发id 用于获取数据\r\n        params:{},//获取数据请求参数\r\n        defaultData:{},//默认数据 默认会赋值给表单\r\n        isDetailData:false,//是否获取子表数据 配合dataId使用\r\n        dataId:\'\',//父子表数据的数据id\r\n    }\r\n}\r\n', 'list', NULL, 1638428042407211009, 1123598821738675201, 1123598813738675201, '2023-03-22 14:34:39', 1123598821738675201, '2023-03-23 09:37:39', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1638717715578908673, '000000', '// columnInit(that){\r\n//     that.setTableOptionsFun(\'amount\',{\r\n//         disabled: true\r\n//     })\r\n//     that.setTableOptionsFun(\'bladeid\',{\r\n//         disabled: true\r\n//     })\r\n// },\r\ncreated(that){\r\n    that.tableOption = {\r\n        ...that.tableOption,\r\n        menuWidth: 160\r\n    }\r\n    \r\n    that.isFormViewControl=true //启用控件\r\n    that.FormViewControlOption={\r\n        ...that.FormViewControlOption,\r\n        viewObj: {\r\n            isShow:false, //是否显示表单\r\n            type:\'dialog\', //弹窗类型  表单:view  抽屉:drawer 弹窗:dialog\r\n            title:\'收款码提现审核\', //标题文本\r\n            width:\'40%\', //弹窗宽度\r\n            destroy:false,//关闭时是否销毁元素\r\n            isGetData:false,//是否需要获取数据\r\n        	carryInit:true,//是否需要重新初始化表单配置\r\n        },\r\n        formId: \'1638776661178085378\', //表单设计id\r\n        formOpenType: \'edit\',\r\n        actionData: {\r\n            type:\'returnData\', //提交类型\r\n            noRouter:true,//不启用路由配置\r\n            closeType:\'hidegetData\',//关闭类型 hide:关闭 hidegetData:关闭并重新获取表格数据\r\n            isMessage:true,//是否有提交成功提示\r\n        },\r\n        btnPermissions: {\r\n            clearBtn: false, //清空按钮\r\n        	cancelBtn: false, //取消按钮\r\n        	submitBtn: false, //提交按钮\r\n        },\r\n        onlineFormId:\'\', //表单开发id 用于获取数据\r\n        params:{},//获取数据请求参数\r\n        \r\n    }\r\n},\r\nstatus_audit(that,row){\r\n    console.log(\'row===\',row)\r\n    let userinfo = JSON.parse(localStorage.getItem(\'saber-userInfo\')) \r\n    that.FormViewControlOption={\r\n        ...that.FormViewControlOption,\r\n        defaultData:{\r\n            id: row.id,\r\n            bladeid: row.bladeid,\r\n            wxname: row.wxname,\r\n            phone: row.phone,\r\n            datetime: row.datetime,\r\n            amount: row.amount,\r\n            statusto: row.statusto,\r\n            auditor: userinfo.content.nick_name\r\n        },//默认数据 默认会赋值给表单\r\n    }\r\n    that.FormViewControlOption.viewObj.isShow = true\r\n}\r\n', 'list', NULL, 1638716805599490050, 1123598821738675201, 1123598813738675201, '2023-03-23 09:42:04', 1123598821738675201, '2023-03-23 14:32:42', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1639113948260757506, '000000', '// buntton () {\r\n//     let add = 1\r\n//     add++\r\n//     console.log(add)\r\n// },\r\n// columnInit(that) {\r\n//     console.log(\'that===\', that)\r\n// }\r\n// getDataEnd(that,res) {\r\n//     console.log(\'that===\', that, \'res===\', res)\r\n// }\r\n\r\n// selectionChange(that,data) {\r\n//     console.log(\'that===\', that, \'data===\', data)\r\n//     console.log(\'that.tableSelectData===\', that.tableSelectData)\r\n// }\r\n// selectable(row,index){\r\n//     return index !== 0\r\n// }\r\n\r\nbeforeAdd(that) {\r\n    console.log(\'that====\',that)\r\n},\r\nbeforeEdit(that,formData) {\r\n    console.log(\'编辑\', that,formData)\r\n}  ', 'list', NULL, 1639098177497362434, 1123598821738675201, 1123598813738675201, '2023-03-24 11:56:33', 1123598821738675201, '2023-03-25 09:52:56', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1640243098212188161, '000000', 'button_add (that, row) {\r\n    console.log(\'that===\', that, \'row\', row)\r\n    that.isTableView=true //启用控件\r\n	that.tableViewOptionData={\r\n		...that.tableViewOptionData,\r\n		viewObj:{\r\n			type:\'dialog\',//打开方式 dialog弹窗  drawer抽屉\r\n			title:\'用户下级表\',//标题\r\n			width:\'80%\',//宽度\r\n			isShow:\'true\',//是否显示\r\n            destroy:true,//关闭时是否销毁元素\r\n		},\r\n        tableId:\'1640243932929015809\',//表单开发id\r\n        searchObj:{\r\n            user_id: row.id\r\n        },//默认搜索值 清空搜索也不会丢失\r\n        params:{\r\n           hideHeader:false,//是否隐藏头部\r\n           transmitFun:()=>{}, //其他方法 可以自定义方法给当前弹出表格调用\r\n           otherParams:{\r\n               user_id: row.id\r\n           },//其他参数 可以自定义参数给当前弹出表格使用\r\n        },//其他配置（扩展功能 默认不用配置）\r\n	}\r\n}', 'list', NULL, 1640241320489992194, 1123598821738675201, 1123598813738675201, '2023-03-27 14:43:24', 1123598821738675201, '2023-03-27 15:53:57', 1, 0);
INSERT INTO `onl_cgform_enhance_js` VALUES (1640247716539351041, '000000', 'setDataFun(that,data) {\r\n    return new Promise(res=>{\r\n        // console.log(\'that.$props===\', that.$props, \'data===\', data)\r\n        // debugger\r\n        let arr = []\r\n        if (that.$props.searchObj) {\r\n            data.forEach(item => {\r\n                // console.log(\'item\', item)\r\n                if (that.$props.searchObj.user_id == item.superiors_ID) {\r\n                    arr.push(item)\r\n                }\r\n            })\r\n            res(arr)\r\n        }else {\r\n            res(arr)\r\n        }\r\n    })\r\n},\r\nadd_user (that, row) {\r\n    // console.log(\'that.$props===\', that.$props, \'row===\', row)\r\n    that.isTableSelectControl=true //启用控件\r\n    that.tableSelectControlOption={\r\n        ...that.tableSelectControlOption,\r\n        title:\'添加用户\',//标题\r\n        isDialog:true,//是否显示控件\r\n        destroy:true,//关闭时是否销毁元素\r\n        width:\'80%\',//弹窗宽度\r\n        tableId:\'1640243932929015809\',//表格id\r\n        option:{\r\n            selectable:(row,index)=>{\r\n                // console.log(\'row\', row)\r\n                if (that.$props.searchObj) {\r\n                    if (row.superiors_ID !== that.$props.searchObj.user_id) {\r\n                        return true\r\n                    }\r\n                }\r\n                \r\n            },\r\n            addBtn:false,\r\n            columnBtn:false,\r\n            searchShowBtn:false,\r\n            refreshBtn:false,\r\n            menu:false,\r\n            selection:true,\r\n            border:true,\r\n            searchMenuSpan: 6,\r\n            searchMenuPosition: \'left\',\r\n            searchIndex: 3,\r\n            column:[\r\n                ...that.tableOption.column\r\n            ],\r\n        },//avue表格相关配置\r\n        multiple:true,//是否多选\r\n        isPage:false,//是否分页\r\n        addType:{\r\n        	type:\'customDispose\',//添加方法类型\r\n        	tableId:\'1640243932929015809\',//添加数据表格id\r\n        	isCell:\'true\',//是否可以编辑\r\n      	},\r\n        defaultData:{},//给勾选数据默认追加的数据\r\n        searchData:{},//表格默认搜索数据 \r\n        carryData:{},//点击确定后默认携带数据\r\n        noDisposeData:true,//不需要做处理\r\n        submitFun:(that,obj)=>{\r\n            // console.log(\'that.$props===\', that.$props, \'obj===\', obj)\r\n            let arr = []\r\n            if (that.$props.searchObj) {\r\n                obj.data.forEach((item, index) => {\r\n                    item.superiors_ID = that.$props.searchObj.user_id\r\n                    arr[index] = this._postAction(`${that.apiRequestHead}/cgform-api/editData/1640243932929015809`,{\r\n                            data:item,\r\n                        })\r\n                })\r\n                Promise.all(arr).then(\r\n                    res => {\r\n                        that.$message({\r\n                            message: \'添加成功\',\r\n                            type: \'success\'\r\n                        })\r\n                        setTimeout(() => {\r\n                            that.$router.go(0)\r\n                        }, 1000)\r\n                    }\r\n                )\r\n            }\r\n        },//自定义确认方法\r\n    }\r\n}', 'list', NULL, 1640243932929015809, 1123598821738675201, 1123598813738675201, '2023-03-27 15:01:45', 1123598821738675201, '2023-03-28 11:42:09', 1, 0);

