INSERT INTO `onl_cgform_enhance_sql` VALUES (1631831120905314305, '000000', 'view', 'SELECT\r\n            lm.id as id,\r\n            wx.wx_name,\r\n            lm.message_content as message_q,\r\n            lma.message_content as message_a,\r\n            lm.message_time,\r\n            lma.message_time as answer_time\r\n        FROM\r\n            chat_log_message  lm\r\n            INNER JOIN chat_wxuser wx on lm.wxuser_id =wx.id\r\n            LEFT JOIN chat_log_message lma on lma.pid=lm.id and lma.message_type =\'a\'\r\n        WHERE\r\n            lm.is_deleted =0\r\n            and lma.is_deleted =0\r\n            and wx.is_deleted =0\r\n            and lm.message_type =\'q\'\r\n            and lm.id =#{id}', NULL, '', 1626103377517432834, 1123598821738675201, 1123598813738675201, '2023-03-04 09:37:12', 1123598821738675201, '2023-03-04 09:37:12', 1, 0, NULL);

